Si vous avez besoin de vérifier votre son, prêtez attention à cet instrument utile ! L'appli Sound Check - Audio Signal Generator est créée pour générer le son à l'aide des fréquences variées à partir de celle très basse à celle très haute. Avec cette utilité pratique vous pouvez vérifier facilement la qualité du son de vos casques ou faire du bruit ! 

Caractéristiques principales de l'appli Sound Check - Audio Signal Generator :
- large variété de fréquences disponibles;
- 4 types de vague à choisir: sinus, en dents de scie, triangle, plat; 
- générateur commode de différents sons et bruits.

Cette appli peut être un outil de vérification pour n'importe quels casques que vous voudrez acheter pour tester la qualité du son tout de suite ou une appli cool pour tous ceux et celles qui aiment interagir avec les sons, les vagues sonores et les effets de son !

