results.description:
Traffic Signs est un test de permis de conduire qui vous aide à préparer votre examen de conduite. Répondez aux questions sur les panneaux de signalisation routière, obtenez autant de points que possible et maîtrisez la plupart des règles de circulation. C'est une des applications les plus utiles pour ceux qui veulent devenir un conducteur professionnel.

LISEZ ET MAÎTRISEZ LES RÈGLES DE CIRCULATION
- Devinez la signification de tous les panneaux routiers;
- Appuyez sur la bonne réponse;
- Essayez d'obtenir autant de points que possible.

DU DÉBUTANT AU PROFESSIONNEL
- Différents niveaux de difficulté;
- Beaucoup de panneaux de signalisation routière pour plusieurs pays;
- Application efficace pour la préparation de votre examen à l'école de conduite.

Traffic Signs contient des panneaux du code de la route pour plusieurs pays, tout ce que vous avez à faire est de choisir la bonne réponse parmi quatre options. Améliorez vos connaissances du code de la route avec Traffic Signs!

